      location: 'Location of image 1',
      dateLost: '2023-01-15',
      dateCreated: '2023-01-10',
    },
    {
      id: 2,
      imageUrl: 'path/to/image2.jpg',
      description: 'Description of image 2',
      location: 'Location of image 2',
